def predict(triples: list[Triple]) -> str:
    clauses = []
    subject = None
    for triple in triples:
        predicate = triple.predicate
        subject_ = triple.subject
        object_ = triple.object

        if subject is None:
            subject = subject_
            if predicate == "author":
                clauses.append(f"{subject} is written by {object_}")
            elif predicate == "country":
                clauses.append(f"{subject} is in {object_}")
            else:
                clauses.append(f"{subject}'s {predicate} is {object_}")
        else:
            if predicate == "followedBy":
                clauses.append(f"{subject} is followed by {object_}")
            elif predicate == "precededBy":
                clauses.append(f"{subject} is preceded by {object_}")
            elif predicate == "capital":
                clauses.append(f"{subject}'s capital is {object_}")
            else:
                clauses.append(f"{subject}'s {predicate} is {object_}")

    sentence = ""
    for i, clause in enumerate(clauses):
        sentence += clause
        if i < len(clauses) - 1:
            if "is in" in clause and "is" in clauses[i+1]:
                sentence += ", which is " + clauses[i+1]
            elif "is" in clause and "is" in clauses[i+1]:
                sentence += ", and " + clauses[i+1]
            else:
                sentence += ", " + clauses[i+1]
    return sentence + "."

